import React from 'react';
import Heading from './Heading';
import Paragraph from './Paragraph';
import List from './List';

function App(){
    return(
        <>
        <Heading></Heading>
        <Paragraph></Paragraph>
        <List></List>
        <List></List>
        </>
        );
    
}



export default App;
